export default function SinglePost() {
  return (
    <div className="singlePost">
      <div className='singlePostWrapper'>
        <img
        src="https://uhurunetwork.com/wp-content/uploads/2019/01/How-to-Write-a-Blog-Post-for-Complex-or-Technical-Industries.jpg"
        alt=""
        />
      </div>
    </div>
  )
}
